from Crypto.Cipher import AES
import base64
key = b'mysecretkey12345'  
iv = b'initialvector123'    
def decrypt(enc):
    cipher = AES.new(key, AES.MODE_CBC, iv)
    decrypted = cipher.decrypt(base64.b64decode(enc))
    return decrypted.rstrip(b"\0").decode('utf-8')
code_ = """

"""
code = decrypt(code_)
exec(code)
